import { View, Text } from 'react-native';
import React from 'react';

const Plant = ({ plant }) => {
  console.log('Plant()');
  return (
    <View>
      <Text>
        {plant.common[0]} should be watered each {plant.watering}
      </Text>
    </View>
  );
};

export default Plant;
